import React, {useState} from 'react';
import { Outlet} from 'react-router-dom';

function MyRecipesPage () {

    const [newRecipeSearch, setNewRecipeSearch] = useState("")
    //search for recipies
    function handleRecipeSubmit (e) {
        e.preventDefault()
        fetch("/search_recipes", {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
                "Accepts": 'application/json'
            },
            body: JSON.stringify({"query": newRecipeSearch})
        })
        .then(response => response.json())
        .then(filteredFoodObject => setSearchedItems(filteredFoodObject["items"]))
        }

    return (
        <div>

<nav class="navbar navbar-expand-lg navbar-light bg-light justify-content-center">
            <div class="collapse navbar-collapse" id="navbarNav">
                <ul class="navbar-nav">
                <li class="nav-item active">
                    <a class="nav-link" href="/my_recipes/breakfast">Breakfast</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" href="/my_recipes/lunch">Lunch</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" href="/my_recipes/dinner">Dinner</a>
                </li>

                <li class="nav-item">
                    <a class="nav-link" href="/my_recipes/dessert">Dessert</a>
                </li>

                <li class="nav-item">
                    <a class="nav-link" href="/my_recipes/drinks">Drinks</a>
                </li>

                <li class="nav-item">
                    <a class="nav-link" href="/my_recipes/appetizers">Appetizers</a>
                </li>
                </ul>
            </div>
        </nav>
        <Outlet />
        </div>

    )
}

export default MyRecipesPage;
